Congrats to our Image Equity Fellows on the debut of #ThroughFireandThunder, a group photo exhibition that explores urgent, untold stories of their communities through the lenses of identity, belonging, memory and migration, coming of age and home. At the link in bio, read more about these artists and their opening at @pioneerworks — plus, see all of their work in our digital gallery.

